cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Shirdi',  'Shirdi (also known as Sainagar) is a city in the Indian state of Maharashtra. It is located in the Rahata taluka of Ahmednagar District. It is accessible via the Ahmednagar–Malegaon State Highway No.10, approximately 83 km (52 mi) from Ahmednagar and 15 km (9.3 mi) from Kopargaon. It is located 185 km (115 mi) east of the Western Seashore line (the Ahmednagar–Manmad road), a very busy route.Shirdi is famously known as the home of the late 19th century saint Shirdi Sai Baba.[1] The Shri Saibaba Sansthan Trust located in Shirdi is one of the richest temple organisations.','https://drive.google.com/uc?export=view&id=1Tx4Bs5wJoIhhlEn1J-IHUlpHquJJWUCv'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Srigonda',  'Shrigonda is a town and a taluka located in the Ahmednagar district of Maharashtra, India. It is situated on the banks of the Bhima River and is approximately 90 kilometers from Pune and 190 kilometers from Mumbai.Shrigonda has a rich historical and cultural heritage, dating back to the Yadava dynasty.Some of the popular tourist attractions in and around Shrigonda include:Kedareshwar Temple - a popular Hindu temple dedicated to Lord ShivaNighoj Potholes - a unique geological formation of naturally carved rock formations created by the Kukadi RiverVeer Savarkar Smarak - a memorial dedicated to Indian freedom fighter Vinayak Damodar SavarkarSiddheshwar Temple - a beautiful temple dedicated to Lord Shiva located on the banks of the Bhima RiverBhandardara - a scenic hill station located about 100 kilometers from Shrigonda, known for its natural beauty and waterfalls.Overall, Shrigonda is a quaint town with a rich historical and cultural heritage, and it is worth a visit for anyone interested in exploring the cultural and natural beauty of Maharashtra.','https://drive.google.com/uc?export=view&id=1av93SnUx6m0YUf1b5JkS-uOSs4054A-p'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Siddhatek',  'Siddhatek is a small town located in the Ahmednagar district of Maharashtra, India. It is situated on the banks of the Bhima River and is approximately 70 kilometers from Pune and 240 kilometers from Mumbai.Siddhatek is known for its ancient Siddhivinayak Temple, one of the eight Ashtavinayak temples in Maharashtra.Some of the other popular tourist attractions in and around Siddhatek include:Bhima Shankar Wildlife Sanctuary - a popular wildlife sanctuary located about 70 kilometers from Siddhatek, known for its rich biodiversity and wildlife, including the Indian Giant Squirrel and the Bengal Tiger.Bhuleshwar Temple - an ancient Hindu temple located about 40 kilometers from Siddhatek, known for its unique architecture and historical significance.Pimpri Dam - a scenic dam located about 20 kilometers from Siddhatek, known for its natural beauty and boating opportunities. ','https://drive.google.com/uc?export=view&id=1eeqri_XEs2v1VolqL9KfE4uhwLxcj0zC'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Kalasubai Harischandragad Wild Life Sanctury',  'Kalasubai Harischandragad Wildlife Sanctuary is located in the Ahmednagar district of Maharashtra, India. It was established in 2018 and covers an area of approximately 610 square kilometers. The sanctuary is named after two prominent peaks in the Western Ghats - Kalasubai and Harishchandragad.The sanctuary is home to a diverse range of flora and fauna. The vegetation in the sanctuary includes evergreen forests, deciduous forests, grasslands, and scrublands. Some of the important species of trees found here include teak, Indian sandalwood, shisham, and bamboo.','https://drive.google.com/uc?export=view&id=1KcpJ1Er-SR7QqBwmh519izHfTadEHe0a'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Narnala wildlife sanctuary / Fort',  'Narnala Wildlife Sanctuary is located in the Amravati district of Maharashtra, India. It covers an area of approximately 12.35 square kilometers and was established in 1997. The sanctuary is named after the Narnala Fort, which is located within its boundaries.The sanctuary is home to a variety of flora and fauna. The vegetation here includes dry deciduous forests, thorn forests, and grasslands. Some of the important species of trees found here include teak, acacia, and neem.The wildlife in the sanctuary includes animals such as leopards, sloth bears, Indian giant squirrels, barking deer, sambar deer, and wild boars. The sanctuary is also home to a variety of bird species such as grey junglefowl, crested serpent eagles, and black-winged kites.','https://drive.google.com/uc?export=view&id=1Vj0ZdLa2LZaXBJU2pGGLX1Nt0Byf26cj'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Balapur Fort',  'Balapur Fort is a historical fort located in Akola district of Maharashtra, India. The fort is believed to have been built during the 14th century by the Bahmani Sultanate, and it later came under the control of the Nizam of Hyderabad.The fort is situated on a hillock and provides a panoramic view of the surrounding landscape. It is a popular tourist destination in the region, especially among history buffs and architecture enthusiasts.The fort has a unique architecture that combines the features of Islamic and Hindu styles. The entrance to the fort is through a large gate, which has intricate carvings on it. There are also several bastions and watchtowers on the fort walls, which were used for defense purposes.','https://drive.google.com/uc?export=view&id=1RnHBwdUScgtvW479zTZ-2B9Wv4KCjmGx'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Chikhaldara (Hill Station)',  'Chikhaldara is a beautiful hill station located in the Amravati district of Maharashtra, India. It is situated at an altitude of 1118 meters above sea level and is known for its scenic beauty, wildlife, and adventure activities.The hill station is surrounded by dense forests, deep valleys, and picturesque waterfalls. It is a popular tourist destination, especially among nature lovers and adventure enthusiasts. The hill station also has a rich cultural and historical heritage.Chikhaldara is home to several wildlife species such as tigers, leopards, sloth bears, barking deer, sambar deer, and Indian giant squirrels. The Melghat Tiger Reserve, which is located near Chikhaldara, is a popular wildlife sanctuary and attracts wildlife enthusiasts from all over the world.','https://drive.google.com/uc?export=view&id=1gj3RUAvTPW-jFJeaIot1o-_FBm0ROtPB'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ambadevi & Ekvira Temple',  'Ambadevi Temple and Ekvira Temple are two important religious sites located in Maharashtra, India.Ambadevi Temple is located in the town of Amravati and is dedicated to Goddess Amba, who is believed to be an incarnation of Goddess Durga. The temple is a popular pilgrimage site and is visited by devotees from all over the country. It is believed that the temple was built during the 11th century and has undergone several renovations over the years.The temple has a beautiful architecture and features intricate carvings on its walls. The main sanctum of the temple houses the idol of Goddess Amba, which is believed to be very powerful and grants the wishes of her devotees. The temple also has several other smaller shrines dedicated to different gods and goddesses.','https://drive.google.com/uc?export=view&id=1L3wt0gp07fhSkhZ1L1Geed5iYXHDSwf0'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ajanta',  'Ajanta is a UNESCO World Heritage Site located in the Aurangabad district of Maharashtra, India. It is a complex of ancient rock-cut caves that date back to the 2nd century BC. The caves are known for their magnificent Buddhist architecture and art, and are considered to be one of the greatest surviving examples of ancient Indian art.There are a total of 30 rock-cut caves at Ajanta, out of which 29 are Buddhist caves and one is a Jain cave. The caves were excavated into the side of a hill and are situated near the Waghora River. The caves were built in two phases, with the first phase starting around 2nd century BC and the second phase starting around the 5th century AD.','https://drive.google.com/uc?export=view&id=1qJg1VxvxH5g8kqJtiiwbbHnhbvws7XaH'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Daultabad Fort',  'Daulatabad Fort is a medieval fortress located in the Aurangabad district of Maharashtra, India. The fort was built in the 12th century AD by the Yadava dynasty and was later captured by several other dynasties, including the Bahmani Sultanate, the Mughals, and the Marathas.The fort is situated atop a hill and is surrounded by high walls, moats, and intricate defense mechanisms. The entrance to the fort is through a narrow passage that has several sharp turns, making it difficult for enemies to enter. The fort also has a series of secret tunnels and trapdoors, which were used by the defenders to ambush and trap their enemies.One of the most impressive features of the fort is its massive cannon, called "Mendha Tope". The cannon is said to have been the largest cannon in the world at the time it was built, and was used to defend the fort against invading armies.','https://drive.google.com/uc?export=view&id=1IJ_pb1Speo1-DkFBIe64BvqehZ812h1d'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ellora',  'Ellora is a UNESCO World Heritage Site located in the Aurangabad district of Maharashtra, India. It is a complex of ancient rock-cut caves that date back to the 6th century AD. The caves are known for their magnificent Hindu, Buddhist, and Jain architecture and art, and are considered to be one of the greatest surviving examples of ancient Indian rock-cut architecture.There are a total of 34 rock-cut caves at Ellora, out of which 12 are Buddhist caves, 17 are Hindu caves, and 5 are Jain caves. The caves were excavated into the side of a basaltic hill and are situated near the Waghora River. The caves were built over a period of several centuries, with the earliest caves dating back to the 6th century AD and the latest caves dating back to the 10th century AD.','https://drive.google.com/uc?export=view&id=1a4FaoP-vezhnsL1HHFuPsVXOlBLi6fUb'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Grishneshwer (Jyotirling)',  'Grishneshwar is a Hindu temple located in the town of Verul in the Aurangabad district of Maharashtra, India. It is one of the 12 Jyotirlingas, which are considered to be the holiest and most sacred temples dedicated to Lord Shiva.The temple is dedicated to Lord Grishneshwar, who is also known as Lord Kusumeswarar or Ghushmeswara. According to legend, the temple was built by a devout woman named Kusuma, who was an ardent devotee of Lord Shiva. The temple is believed to have been built during the 18th century and is known for its beautiful architecture and intricate carvings.The temple complex consists of a main shrine, which houses the lingam of Lord Grishneshwar, as well as several smaller shrines dedicated to other deities. The lingam is made of black stone and is believed to have been self-manifested or swayambhu. The temple also has a beautiful courtyard and a large water tank, which is known as Shivalaya.','https://drive.google.com/uc?export=view&id=1psEfM3NxDjjbgxD0Zw5YcoM_8gx6Ay30'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Shri Bhadra Maruti Temple',  'Shri Bhadra Maruti Temple is a Hindu temple located in the city of Khuldabad in the Aurangabad district of Maharashtra, India. It is dedicated to Lord Hanuman, who is also known as Maruti, and is believed to be one of the most powerful and revered deities in Hindu mythology.The temple is situated at the foot of a hill and is surrounded by lush greenery and scenic beauty. It is believed to be one of the oldest and most important temples dedicated to Lord Hanuman in the region, and attracts thousands of devotees every year.The main attraction of the temple is the 3.5 feet tall idol of Lord Hanuman, which is believed to be one of the most powerful and divine idols of the deity. The idol is made of black stone and is believed to have been installed by a saint named Bhadra in the 14th century.','https://drive.google.com/uc?export=view&id=1ufz11jR67E5W22J2XbPug11nQkSNBt4D'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Bibi Ka Makbara',  'Bibi Ka Makbara is a mausoleum located in the city of Aurangabad in the state of Maharashtra, India. It was built in the 17th century by the Mughal Emperor Aurangzeb in memory of his wife, Dilras Banu Begum.The mausoleum is also known as the "Taj Mahal of the Deccan" due to its striking resemblance to the iconic Taj Mahal in Agra, which was built by Aurangzeb  father, Emperor Shah Jahan.The mausoleum is built on a raised platform and is surrounded by a beautiful garden with water channels, fountains, and pathways. The central structure is a square-shaped building with a dome and minarets, which is made of white marble and decorated with intricate carvings and inlaid designs.Inside the mausoleum, there is a tomb that contains the mortal remains of Dilras Banu Begum. The tomb is made of marble and is surrounded by delicate lattice work and exquisite carvings.','https://drive.google.com/uc?export=view&id=1ukANqYmZ0NZ-MWT-EhzQC2ZqzSorMEzR'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Paithan - Jayakwadi',  'Paithan is a small town located in the Aurangabad district of Maharashtra, India. It is situated on the banks of the Godavari River, which is one of the major rivers in India. Paithan is known for its rich history, culture, and heritage, and is also famous for the Jayakwadi Dam and Reservoir, which is located nearby.The Jayakwadi Dam and Reservoir is one of the largest irrigation projects in India, and is a major source of water for the surrounding areas. The dam is built across the Godavari River and creates a huge reservoir that provides water for irrigation, drinking, and other purposes. The reservoir is also a popular tourist attraction and offers boating and fishing facilities for visitors.Paithan is also known for its historical and cultural significance. It was once an important center of trade and commerce in ancient India and was known for its fine silk textiles, which were highly prized throughout the region. The town is also home to several ancient temples, including the famous Paithan Ganesh Temple, which is dedicated to Lord Ganesha, the Hindu god of wisdom and prosperity.','https://drive.google.com/uc?export=view&id=1RuBG_J0_BoueMuMLQMLgPB2ZSk32c4IY'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Kapildhara (Ashram Of Kapilmuni)',  'Kapildhara is an ashram located in the Nanded district of Maharashtra, India. It is named after the famous sage Kapilmuni, who is believed to have lived and meditated at the site. The ashram is situated in a beautiful natural setting, surrounded by hills and forests, and is considered to be a sacred site by Hindus.According to Hindu mythology, Kapilmuni was a renowned sage who is believed to have written the famous philosophical treatise, the Sankhya Sutras. He was also considered to be an incarnation of Lord Vishnu, the Hindu god of preservation and one of the most important deities in Hinduism.The ashram at Kapildhara is believed to have been established by Kapilmuni himself, and is a popular destination for spiritual seekers and devotees of Lord Vishnu. The ashram is known for its peaceful atmosphere and beautiful surroundings, which are said to be conducive to meditation and spiritual practices.','https://drive.google.com/uc?export=view&id=1Mga_MHhhvrTF2bEuDikKM_KYua0cickf'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Parali Vaishnath',  'Parali Vaishnath is a small town located in the Beed district of Maharashtra, India. It is a holy site for Hindus, as it is home to the Parali Vaishnath Temple, which is dedicated to Lord Shiva, one of the most important deities in Hinduism.The Parali Vaishnath Temple is an ancient temple that is believed to have been built by the Pandavas during their exile from the kingdom of Hastinapur. The temple is located on a hill, and devotees have to climb a flight of steps to reach it. The temple complex also includes several other shrines and a large pond, which is believed to have healing properties.The town of Parali Vaishnath is also known for its natural beauty, as it is situated in a scenic location surrounded by hills and forests. It is a popular destination for trekking and hiking, as well as for spiritual tourism.','https://drive.google.com/uc?export=view&id=1PwPFRAuNr0TLumZDV7pOfv4GtG17Hk1J'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ambagar Fort',  'Ambagarh Fort, also known as Ambareshwar Fort, is an ancient fort located in the Gadchiroli district of Maharashtra, India. The fort is believed to have been built during the 17th century by the Gond dynasty rulers.The fort is situated on top of a hill and offers a panoramic view of the surrounding landscape. It is surrounded by a deep moat and has several bastions and watchtowers. The fort was strategically important as it was located on a trade route that connected the kingdoms of Vidarbha and Andhra Pradesh.Today, the Ambagarh Fort is in a state of ruins, but it still attracts visitors who are interested in history and architecture. The fort is accessible by a steep trek through a forested area, and visitors can explore the various structures and ruins within the fort complex.','https://drive.google.com/uc?export=view&id=1dTEDtgm_62lbqbJCULETyUoIzQ_69Zdp'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Chinchgad',  'Chinchgad, also known as Chinchwad, is a suburb located in the Pune district of Maharashtra, India. It is situated on the banks of the Pavana River and is known for its industrial and commercial activities.Chinchgad is home to several large manufacturing plants and factories, including those in the automobile, engineering, and pharmaceutical industries. It is one of the fastest-growing suburbs of Pune and has seen significant development in recent years.Apart from its industrial activities, Chinchgad is also home to several tourist attractions, including the Chinchwad Gaon Devi Temple, which is dedicated to the Hindu goddess Devi. The temple is situated on a hill and offers a panoramic view of the surrounding area.','https://drive.google.com/uc?export=view&id=1V-MDTTc6b3Doky44vqGh48o5iF0XRoOg'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sheogaon (Samadhi of Gajanan Maharaj)',  'Shegaon is a small town located in the Buldhana district of Maharashtra, India. It is an important pilgrimage center for Hindus, as it is the site of the Samadhi (final resting place) of Gajanan Maharaj, a revered saint and spiritual leader who lived during the late 19th century.Gajanan Maharaj is considered to be an incarnation of Lord Dattatreya, who is believed to be a combination of the Hindu trinity of Brahma, Vishnu, and Shiva. He is known for his teachings on spirituality and his emphasis on the importance of devotion and service to others.The Samadhi of Gajanan Maharaj is a large complex that includes several temples, gardens, and other facilities for visitors. The main temple is a beautiful structure made of white marble and is dedicated to Gajanan Maharaj. The complex also includes a museum that displays the personal belongings and teachings of the saint.','https://drive.google.com/uc?export=view&id=1WND8j-Q8zjEI0pIhdoG8eCkE39ll1qAn'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Lonar Crater',  'The Lonar Crater is a meteorite impact crater located in Maharashtra, India. It is one of the few impact craters on Earth that has been formed in basalt rock. The crater is circular in shape and has a diameter of around 1.8 kilometers. It is believed to have been created by the impact of a meteorite about 52,000 years ago.The Lonar Crater is a unique natural phenomenon and has attracted the attention of scientists and researchers from around the world. The lake within the crater is also known for its alkaline water, which is rich in minerals and supports a unique ecosystem of microorganisms.','https://drive.google.com/uc?export=view&id=1OrfAkN1uCNK_u2Q8_GPw3IytLbXcWJTz'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Tadoba, Tadoba national park',  'Tadoba Andhari Tiger Reserve, also known as Tadoba National Park, is a wildlife reserve located in the Chandrapur district of Maharashtra, India. It is one of the largest and oldest national parks in Maharashtra, covering an area of about 625 square kilometers.Tadoba National Park is famous for its tiger population and is one of the best places in India to spot tigers in the wild. Apart from tigers, the park is also home to other wildlife such as leopards, wild dogs, sloth bears, Indian gaur, sambar deer, spotted deer, and many species of birds.The park is named after the Tadoba Lake, which is situated in the center of the reserve. The Andhari River, which flows through the park, is also a major source of water for the wildlife.','https://drive.google.com/uc?export=view&id=1lzSF9xXSN6ybzi22aO2z8AmvVvA0PSlg'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Nagbhir (Ghodajhari) Picnic Spot',  'Nagbhid (Ghodajhari) is a small village located in the Bhandara district of Maharashtra state in India. It is situated in the midst of scenic hills, forests, and waterfalls, making it a popular picnic spot for locals and tourists.The main attraction of the Nagbhid (Ghodajhari) picnic spot is the Ghodazari dam, which is a beautiful and peaceful place to relax and enjoy nature. The dam provides water to the surrounding villages and is also a popular spot for boating.There are also several trekking trails in the surrounding hills, where you can explore the lush green forests and see some exotic flora and fauna. The nearby waterfalls, such as the Ambagad Fort Waterfall and the Nagadongar Waterfall, are also worth a visit.Overall, Nagbhid (Ghodajhari) is a great place to unwind and enjoy the natural beauty of Maharashtra.','https://drive.google.com/uc?export=view&id=1vW1YLk_CISqYTjuwaZ6J1nNbumsL9Jed'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Anerdam Wildlife Sanctury',  'The AnerDam Wildlife Sanctuary is located in Shirpur talukas of Dhule district. The sanctuary is spread over southwestern side of Satpura hill ranges. This sanctuary is spread around the catchment area of Aner river specially above the high flood level around the Aner Dam. This sanctuary has common boundary with Yawal Wildlife Sanctuary in Jalgaon district and forest area of Khargone district in Madhyapradesh.The nearest rail head is Jalgaon Town of Maharashtra state which is 71 km from the sanctuary. Regular buses are available from Shirpur and lasur Road Bus Stand. The sanctuary is open for visitors from sunrise to sunset. There are many hotels and resorts located near Shirpur town.','https://drive.google.com/uc?export=view&id=1NCsNC8PrHcQf4A2Rtvoad2XKAcMMdBFN'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Jinganur (Bhamergargh Wildlife Sanctury)',  'The Jinganur Wildlife Sanctuary is a protected area located in the Shimoga district of Karnataka, India. It is situated in the Western Ghats, a mountain range that runs along the western coast of India and is known for its rich biodiversity.The sanctuary covers an area of around 490 square kilometers and is home to a diverse range of wildlife, including tigers, leopards, sloth bears, Indian gaurs, sambar deer, spotted deer, barking deer, wild boars, langurs, and several species of birds.The vegetation of the sanctuary is also diverse, with a mix of evergreen, semi-evergreen, and deciduous forests. The sanctuary is known for its beautiful waterfalls, such as the Jogigundi Falls and the Koodlu Theertha Falls.The sanctuary also has several trekking trails, which offer visitors an opportunity to explore the area lush forests and enjoy its natural beauty. The best time to visit the Jinganur Wildlife Sanctuary is between the months of October and March, when the weather is pleasant and the wildlife is more active.','https://drive.google.com/uc?export=view&id=1xspq_IOjC_naF4FNq9PGkS5futJQxY1q'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Nayagaon Wild Life Sanctury',  ' The Naigaon Wildlife Sanctuary is a protected area located in the Nanded district of Maharashtra, India. It is situated in the Satpura Hills and covers an area of around 250 square kilometers.The sanctuary is home to a variety of wildlife, including tigers, leopards, sloth bears, Indian gaurs, chitals, sambar deer, nilgais, wild boars, and several species of birds. The vegetation of the sanctuary is also diverse, with a mix of dry deciduous forests, thorn forests, and grasslands.The best time to visit Naigaon Wildlife Sanctuary is between the months of November and February, when the weather is pleasant and the wildlife is more active. Visitors can go on jungle safaris and trekking expeditions to explore the sanctuary and spot its diverse wildlife.Overall, Naigaon Wildlife Sanctuary is a great place to experience Maharashtra natural beauty and wildlife.','https://drive.google.com/uc?export=view&id=191kP9OMf5Pthwgq-S2vXlZo-mLIHNoOx'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Aundha Nagnath ( Jyotirling)',  'Aundha Nagnath is a small town located in the Hingoli district of Maharashtra, India. It is home to the Aundha Nagnath Temple, which is one of the twelve Jyotirlingas, a sacred symbol of Lord Shiva.The Aundha Nagnath Temple is an ancient temple and is believed to have been built by the Rashtrakutas in the 8th century. The temple complex consists of several shrines and a large courtyard.The main shrine is dedicated to Lord Shiva and houses the Jyotirlinga. The temple also has several other important deities, including Lord Vishnu, Lord Ganesha, and Goddess Parvati.The Aundha Nagnath Temple is considered one of the most important pilgrimage sites in Maharashtra and attracts a large number of devotees throughout the year, especially during the Mahashivratri festival.','https://drive.google.com/uc?export=view&id=1fdYY_gUyjBpQlCM7bIo2sZrU36XRSogq'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Mallinath Digambar Jain',  'At Shirad Shahapur village of Aundha Nagnath taluka place falls one of the most historical temples of Jain community. There exists statue of Lord Mallinath which is about 300 years old. There is legendary story of establishment of this temple. Years back the idol was placed at Ardhapur. Bhattarak shree Premanand once saw this idol placed in between other confuted idols and was annoyed. He seeked permission from Nizam to move the idol to Karanja.Nizam permitted him to take the idol to Karanja. While he was traveling he once stayed at shirad shahapur. There he saw dream in which he got message to establish the idol at shirad shahpur, only according to the famous temple came in to existence. Now it is well constructed with facilities for pilgrims to stay. Lot of Jain pilgrims from all over India visit this place.','https://drive.google.com/uc?export=view&id=1TGusfDJP6V4gi1OkP_UG1s0i5IwD0pRv'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Muktainager, Changdev Maharaj, Bhusawal',  'Muktainagar is a small town located in the Jalgaon district of Maharashtra, India. It is famous as the birthplace of the great saint, Changdev Maharaj.Changdev Maharaj was a 14th-century saint and poet who is known for his devotional poetry in Marathi. He was a follower of the Nath Sampradaya, a religious sect that emphasizes the importance of yoga, meditation, and self-realization.Changdev Maharaj is believed to have spent most of his life in the forests of Maharashtra, where he practiced yoga and meditation. His poetry is deeply philosophical and expresses his devotion to Lord Vitthal, a popular deity in the region.The town of Muktainagar has several sites associated with Changdev Maharaj, including the Changdev Maharaj Samadhi Mandir, which is dedicated to him. The town also has a temple dedicated to Lord Vitthal, which is a popular pilgrimage site for devotees.','https://drive.google.com/uc?export=view&id=1pigrFv7YT3OMkq0Y7wgo7qpPcwdGalPg'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Amalner Fort',  'Amalner Fort is a land fort which is situated in Amalner of District Jalgaon of Maharashtra. Amalner is a town situated in the banks of the Bori River in the Jalgaon district. In the past, Amalner was protected by a walled fortification surrounding it, giving it some safeguard and protection against invasions and attacks. These kinds of cities are commonly termed as “walled cities”. One side of the town was protected naturally by the Bori River, which was further strengthened by raising walls and bastions along the edge of the river. The other three sides were protected by thick 20 feet high walls and three well guarded entrances.Amalner came under the administration of Madhavrao who was the then representative of the Peshwa in AD 1818. At the instructions of the Peshwa, Madhavrao decided to hand over the fort to the British. Ali  was the Jamadaar of the fort and he has a Arab Battalion under his supervision, however, opposed this decision. Col Haskins of the British army brought a battalion of the Bhills to Amalner and started bombarding the fort from beyond the riverside.','https://drive.google.com/uc?export=view&id=1bv5hTji0RzZ-Q60cZ6tQCHIAQ7soxW0m'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('The Matsyodari Devi Temple',  'The Matsyodari Devi Temple is a Hindu temple dedicated to Goddess Matsyodari, located in the city of Jalna, Maharashtra, India. The temple is located on a hill called "Matsyagiri", which is about 2.5 km from the city center.According to Hindu mythology, Matsyodari Devi is an incarnation of Goddess Durga and is also known as Renuka or Yellamma. The temple is believed to have been built during the reign of the Satavahanas, an ancient dynasty that ruled the Deccan region.The temple complex consists of several shrines, including the main shrine of Matsyodari Devi. The temple architecture is typical of the Maratha style, with a towering shikhara and a large courtyard.The temple attracts a large number of devotees, especially during the Navratri festival, which is celebrated with great fervor. The temple is also a popular destination for tourists and offers stunning views of the surrounding hills and valleys.','https://drive.google.com/uc?export=view&id=1tlZmoWPrtlNC3xBVyxaLLpklZeZIEI2_'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Shree Ganesh of Rajur',  'Shree Ganesh Temple of Rajur is a Hindu temple located in the village of Rajur in the Ahmednagar district of Maharashtra, India. The temple is dedicated to Lord Ganesha, the elephant-headed deity, who is revered as the remover of obstacles and the god of wisdom and good fortune.The temple is situated on the banks of the Sina river and is believed to have been built during the reign of the Yadavas in the 12th century. The architecture of the temple is typical of the Hemadpanthi style, which is characterized by the use of locally available materials such as stone and lime.The temple complex consists of several shrines, including the main shrine of Lord Ganesha. The idol of Lord Ganesha is made of black stone and is believed to be a swayambhu, meaning it is self-manifested.The temple attracts a large number of devotees, especially during the Ganesh Chaturthi festival, which is celebrated with great enthusiasm. The festival is marked by the installation of the idol of Lord Ganesha, which is worshipped with offerings of flowers, sweets, and fruits.Overall, the Shree Ganesh Temple of Rajur is a must-visit destination for those interested in spirituality and culture, and offers a glimpse into the rich history and traditions of the region.','https://drive.google.com/uc?export=view&id=1ufz11jR67E5W22J2XbPug11nQkSNBt4D'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Panhala fort',  'Panhala Fort is a historic fort located in the Panhala town of the Kolhapur district in the Indian state of Maharashtra. It is believed to have been built by the Shilahara dynasty in the 12th century AD and has since been ruled by several dynasties such as the Yadavas, Bahamanis, Adil Shahi dynasty, and the Marathas.The fort is situated at an altitude of 845 meters and offers panoramic views of the surrounding Sahyadri mountain range. The fort has several structures, including the Teen Darwaza (Three Gates), the Andhar Bavadi (Dark Well), the Ambabai Temple, and the Someshwar Temple. The Teen Darwaza is a notable structure that consists of three gates, each with a unique architectural style.The fort also played an important role in the history of the Maratha Empire, as it was the site of several battles between the Marathas and the Mughals. It was also the place where Shivaji, the founder of the Maratha Empire, spent several years during his early years as a ruler.','https://drive.google.com/uc?export=view&id=1wpopeWbtbhErlqjdYtYliurZDHf_wZ9g'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Vishalgad Fort',  'Vishalgad Fort is a historic fort located in the Kolhapur district of Maharashtra, India. It is situated at an altitude of 1118 meters and is believed to have been built during the reign of the Maratha ruler Shivaji Maharaj.The fort is surrounded by thick forests and offers breathtaking views of the Sahyadri mountain range. The fort has several structures, including the Ballekilla (Upper Fort), the Padmavati Temple, and the Konkan Darwaja (Konkan Gate).The Ballekilla is the highest point of the fort and offers panoramic views of the surrounding hills and valleys. The Padmavati Temple is a notable structure that is dedicated to the goddess Padmavati and is believed to have been built during the reign of Shivaji Maharaj.The Konkan Darwaja is another notable structure that serves as the main entrance to the fort. It is believed to have been built during the reign of the Maratha king Chhatrapati Sambhaji Maharaj.','https://drive.google.com/uc?export=view&id=1pHC-u3oTVWuPi5X5E64Zxp4cRXFIkH9H'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Rankala lake',  'Rankala Lake is a beautiful lake located in the city of Kolhapur in the Indian state of Maharashtra. It is a natural lake that covers an area of about 47 acres and is surrounded by lush greenery, making it a popular destination for nature lovers and tourists.The lake is named after the Rank Bhairav Temple, which is located on its banks. It is believed that the lake was built during the reign of the Maratha ruler Shivaji Maharaj and was used for irrigation and other purposes.Rankala Lake is a popular destination for boating and offers several activities such as speed boating, pedal boating, and row boating. Visitors can also enjoy a leisurely walk along the lakes promenade or relax in the gardens located on its banks.The lake is also home to several species of birds and is a popular spot for birdwatching. It is also surrounded by several restaurants and food stalls that offer a variety of local delicacies.','https://drive.google.com/uc?export=view&id=1Pg1Y-a1IBUTMg4dtRqcUbAd1Ak22ZpvC'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Mahalaxmi Temple',  'Mahalaxmi Temple is a famous Hindu temple located in the city of Kolhapur in the Indian state of Maharashtra. It is dedicated to the goddess Mahalaxmi, who is believed to be the consort of Lord Vishnu.The temple is an important pilgrimage site for Hindus and is believed to have been originally built in the 7th century AD. It has undergone several renovations and additions over the years and is now a magnificent temple complex that attracts millions of devotees and tourists every year.The main shrine of the temple houses the idol of Mahalaxmi, which is made of black stone and is adorned with gold ornaments. The idol is believed to be self-manifested, meaning that it was not carved or sculpted by human hands.The temple complex also includes several other shrines dedicated to various deities, including Lord Vishnu and Lord Shiva. The temple architecture is a blend of Maratha, Jain, and Hemadpanthi styles and features intricate carvings and designs.','https://drive.google.com/uc?export=view&id=1Z1YsxcX4mosD-V0ai-kgBNB91zeYHRLJ'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Maharaja palace',  'Maharaja Palace, also known as the New Palace, is a magnificent palace located in the city of Kolhapur in the Indian state of Maharashtra. It was built in 1884 by the Maharaja of Kolhapur, Shahu Maharaj, and is a stunning example of Indo-Saracenic architecture.The palace is spread over an area of about seven acres and is surrounded by lush green gardens. It is built using black polished stone and features intricate carvings and designs on its walls and pillars. The palace also houses a museum that showcases the rich history and culture of the Maratha dynasty.The museum displays a wide variety of artifacts and exhibits, including royal costumes, jewelry, weapons, paintings, and sculptures. It also has a collection of rare and ancient manuscripts, including the Vedas and the Puranas.One of the main attractions of the palace is the Durbar Hall, which is a grand hall that was used for official ceremonies and meetings by the Maharajas. The hall features a high ceiling, chandeliers, and intricate carvings and designs on its walls and pillars.The palace also has a beautiful courtyard, which is surrounded by a series of small temples dedicated to various Hindu deities. These temples are made of black polished stone and feature intricate carvings and designs.','https://drive.google.com/uc?export=view&id=1HrkVXrtrAUE8-fulVgZL-AtDZHhelZYf'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('City park',  'Latur City Park is a popular public park located in the city of Latur in the Indian state of Maharashtra. It is spread over an area of around 8 acres and is a popular recreational spot for locals and tourists alike.The park features lush green lawns, flower beds, and a variety of trees and plants. It also has a jogging track, a childrens play area, and a small lake that offers boating facilities. There are also several benches and seating areas throughout the park, making it a great place to relax and enjoy the natural surroundings.In addition to the recreational facilities, Latur City Park also has a food court that offers a range of snacks and refreshments. The park is well-maintained and offers a peaceful escape from the hustle and bustle of the city.','https://drive.google.com/uc?export=view&id=1Ozld94kVd1K2-xImr8g8Z4ewyCsG7zik'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Gateway of India',  'The Gateway of India is a famous historical monument located in Mumbai, Maharashtra, India. It is an iconic structure and is one of the most recognized landmarks of Mumbai.The Gateway of India was built in 1924 to commemorate the visit of King George V and Queen Mary to Mumbai. It is an arch monument that stands at a height of 26 meters and is built using yellow basalt and reinforced concrete. The structure is a fusion of Hindu and Muslim architectural styles and features intricate carvings and designs.The Gateway of India overlooks the Arabian Sea and is a popular tourist attraction. It is a gathering place for locals and tourists alike and offers stunning views of the sea and the nearby Elephanta Island.','https://drive.google.com/uc?export=view&id=1CPgHtWzZOLK4Wm_sv4o-NQ_Z94oa4xWC'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Marine Drive',  'Marine Drive is a 3.6 km long coastal road in Mumbai, Maharashtra, India. It is a curved road that stretches along the Arabian Sea, connecting Nariman Point to Babulnath and Malabar Hill.Marine Drive is popularly known as the "Queens Necklace" due to the way it looks at night when the streetlights illuminate the road and resemble a string of pearls. It is a prominent landmark of Mumbai and is often featured in movies and television shows.The road is flanked by palm trees on one side and the Arabian Sea on the other, offering stunning views of the sea and the Mumbai skyline. Marine Drive is a popular destination for locals and tourists alike, who come here to take a leisurely walk, jog, or just enjoy the breeze.Marine Drive also has several prominent buildings and landmarks along its stretch, including the famous Chhatrapati Shivaji Terminus, the Taraporewala Aquarium, and the Girgaon Chowpatty beach.','https://drive.google.com/uc?export=view&id=1Vsv3D0yfrp5CFl6siI-xqvFz9qmFi51v'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Juhu Beach',  'Juhu Beach is a famous and popular beach located in the suburb of Juhu in Mumbai, Maharashtra, India. It stretches over 6 km along the Arabian Sea and is known for its beautiful sunsets, refreshing sea breeze, and lively atmosphere.Juhu Beach is a popular destination for locals and tourists alike, who come here to relax, sunbathe, and enjoy the various street food stalls that offer a range of local delicacies. The beach also attracts fitness enthusiasts who come here for a morning jog or to practice yoga.In addition to the beach itself, Juhu also has several prominent landmarks and attractions nearby, including the iconic Juhu Chaupati, the famous ISKCON temple, and the Prithvi Theatre.','https://drive.google.com/uc?export=view&id=1bCJRPnqH7bqiCAJMzR2cAnvPZUNywmJt'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Elephanta caves',  'The Elephanta Caves are a UNESCO World Heritage Site located on Elephanta Island, which is about 10 kilometers from Mumbai, India. The caves are a group of rock-cut temples that were created between the 5th and 8th centuries CE. They are known for their intricate carvings, especially those of the Hindu god Shiva.The caves consist of a main group of five caves, as well as several smaller caves. The main cave, also known as the Shiva Cave, is the largest and most impressive of the group. It has a large hall with a high ceiling supported by massive pillars, and features numerous carvings of Shiva in various forms, including the famous three-faced sculpture of Shiva.The other caves on the island also feature carvings of deities and mythological scenes, as well as inscriptions in Sanskrit and Prakrit. The Elephanta Caves are considered to be one of the finest examples of Indian rock-cut architecture and sculpture.','https://drive.google.com/uc?export=view&id=1FdbD5I4ScG3ZPlSg6J5mPokQ6rf4tI5K'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Nehru Planetarium',  'The Nehru Planetarium is a public planetarium located in New Delhi, India. It was inaugurated on February 6, 1984, and is named after Indias first Prime Minister, Jawaharlal Nehru. The planetarium is managed by the Nehru Memorial Museum and Library, and is a popular destination for both tourists and locals.The planetarium features a dome-shaped theater that can accommodate up to 200 people at a time. The theater has a state-of-the-art projector that displays a realistic view of the night sky, as well as images and videos of planets, stars, and galaxies. The planetarium also has interactive exhibits that provide visitors with a hands-on experience of astronomy and space science.In addition to its regular shows, the Nehru Planetarium also organizes special events and programs, such as astronomy workshops, lectures, and telescope viewing sessions. The planetarium is open to the public from Tuesday to Sunday, and admission is free for children under the age of four.','https://drive.google.com/uc?export=view&id=1x5RoqDC4Kde2-ApZ0Sqz6Q0C0d9X_tUs'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sanjay Gandhi National park (Zoo & Kanheri Caves )',  'The Sanjay Gandhi National Park is a protected area and wildlife sanctuary located in Mumbai, India. It covers an area of over 104 square kilometers and is home to a variety of flora and fauna, including several endangered species.The park is also home to a zoo that houses over 150 species of animals, including tigers, lions, leopards, and elephants. The zoo is spread over an area of 12 hectares and is a popular destination for tourists and locals alike.One of the major attractions of the park are the Kanheri Caves, which are a group of rock-cut Buddhist caves that date back to the 1st century BCE. The caves are located deep within the park and are known for their impressive architecture, intricate carvings, and beautiful sculptures. The caves have been declared a UNESCO World Heritage Site and are a popular destination for history buffs and architecture enthusiasts.','https://drive.google.com/uc?export=view&id=1rvAUJSET4a5twORDwDSlZpjjDchGo9B1'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Pench National park',  'Pench National Park is a protected area and wildlife sanctuary located in the central Indian state of Madhya Pradesh, bordering the state of Maharashtra. It covers an area of over 750 square kilometers and is known for its rich biodiversity and natural beauty.The park is named after the Pench River, which flows through the park and is an important source of water for the local flora and fauna. The park is home to a variety of wildlife, including tigers, leopards, wild dogs, sloth bears, and Indian bison. It is also a birdwatchers paradise, with over 250 species of birds recorded in the park.The landscape of Pench National Park is characterized by hills, valleys, and forests, and offers several opportunities for outdoor activities such as trekking, hiking, and camping. The park has several trekking trails that lead to scenic spots and offer breathtaking views of the surrounding landscape.','https://drive.google.com/uc?export=view&id=1x7hhg8SNkhoZh_5sS_KhjLfdNoYo2-eO'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ramtek ( Shri Ram Temple )',  'Ramtek is a small town located in the Nagpur district of the Indian state of Maharashtra. It is known for its religious significance and is a popular pilgrimage destination for Hindus. The town is home to several temples, including the Shri Ram Temple, which is one of the most famous temples in the area.The Shri Ram Temple in Ramtek is dedicated to Lord Rama, one of the most revered deities in Hinduism. The temple is situated on a hilltop and offers panoramic views of the surrounding landscape. The temple complex consists of several shrines, including those dedicated to Lord Rama, his wife Sita, and his brother Lakshmana.','https://drive.google.com/uc?export=view&id=1JWreHU12B3q22gf41D8lSxdrW794Lt0_'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Maharaj Baug, zoo',  'Maharaj Baug Zoo is a zoological garden located in Nagpur, a city in the Indian state of Maharashtra. The zoo covers an area of around 33 hectares and is home to a variety of animals, including tigers, lions, leopards, elephants, and several species of birds.The zoo is a popular destination for tourists and locals alike, and is known for its conservation efforts and education programs. The zoo aims to raise awareness about the importance of wildlife conservation and the need to protect endangered species.Apart from the animal enclosures, Maharaj Baug Zoo also has several other attractions, including a botanical garden, a musical fountain, and a toy train. The botanical garden features a variety of plant species, including several rare and endangered ones. The musical fountain is a popular attraction among visitors, and features a spectacular display of water and light.','https://drive.google.com/uc?export=view&id=1gs_G9y4e93Hh7UWzB4FoQjZS7vFWKWwR'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sardar Sarovar Project - kevadia dam,',  'The Sardar Sarovar Project is a large-scale hydraulic engineering project located in the Indian state of Gujarat. The project was initiated in 1961 and completed in 2017, and involved the construction of a series of dams, canals, and reservoirs on the Narmada River.The Kevadia Dam is one of the main components of the Sardar Sarovar Project, and is located in the town of Kevadia, in the Narmada district of Gujarat. The dam is one of the tallest in the world, with a height of 163 meters and a length of 1.2 kilometers. It is designed to provide irrigation water to farmers in the region, as well as generate hydroelectric power.','https://drive.google.com/uc?export=view&id=1PSVYyY6NLCKGFJIdJNmlTG6Yd7NR3df4'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Toranmal, Toranmal shiv temple, Hidimba forest,',  'Toranmal is a hill station and a pilgrimage site located in the Nandurbar district of the Indian state of Maharashtra. The town is known for its natural beauty, serene atmosphere, and religious significance. One of the main attractions of Toranmal is the Toranmal Shiv Temple.The Toranmal Shiv Temple is a popular pilgrimage destination for Hindus, and is dedicated to Lord Shiva, one of the most revered deities in Hinduism. The temple is located on a hilltop, and offers panoramic views of the surrounding landscape. The temple architecture features intricate carvings and sculptures, and reflects the rich cultural heritage of the region.Hidimba Forest is another popular attraction in Toranmal, and is known for its dense forests and scenic waterfalls. The forest is home to a variety of flora and fauna, including several rare and endangered species. The forest is also believed to have been the abode of Hidimba, a demoness mentioned in the Hindu epic Mahabharata.','https://drive.google.com/uc?export=view&id=1nH1Iw5lahUnpWi9wcjzO1733rBS0482d'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Trimbakeshwar (Jyotirling)',  'Maharashtra. The town is known for its ancient Trimbakeshwar Temple, which is one of the 12 Jyotirlingas (sacred shrines of Lord Shiva) in India.The Trimbakeshwar Temple is a major pilgrimage site for Hindus, and is dedicated to Lord Shiva. The temple is believed to have been built in the 18th century, although its origins can be traced back to the 8th century AD. The temple architecture features intricate carvings and sculptures, and reflects the rich cultural heritage of the region.The temple is located on the banks of the Godavari River, and is surrounded by scenic beauty. The temple also has several other attractions, including a holy pond called Kushavarta, which is believed to be the source of the Godavari River.','https://drive.google.com/uc?export=view&id=1gTf6iwxUAQ92wUYzeWE52om9LawVcSZD'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sinhastha Kumbh Mela(Punchvati,godavari Ghat)',  'The Sinhastha Kumbh Mela is a major Hindu pilgrimage festival held every 12 years in India. The festival is celebrated in four different locations in India, with the most significant one being held in the city of Ujjain in Madhya Pradesh.During the festival, millions of Hindu devotees gather to take a dip in the sacred rivers, which are believed to have the power to cleanse ones sins and grant blessings. The festival is held at the banks of the Godavari river in Nashik, and is known as the Nashik Kumbh Mela.The festival is held over a period of 3 months, and attracts devotees from all over the world. The festival features several rituals, including the taking of a holy dip in the river, the offering of prayers and puja, and the participation in various cultural events and discourses.','https://drive.google.com/uc?export=view&id=1EiIUPt5vclI45PwRqCb6R6sH-NF_z-Fg'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Igatpur',  'Igatpuri is a hill station and a popular tourist destination located in the Nashik district of the Indian state of Maharashtra. The town is known for its scenic beauty, lush green forests, and serene atmosphere, making it a popular getaway from the hustle and bustle of the city.One of the main attractions of Igatpuri is its natural beauty. The town is surrounded by the Sahyadri mountain range and is home to several waterfalls, including the popular Ashoka Falls and the Bhatsa River Valley. The town is also known for its beautiful trekking trails, which offer breathtaking views of the surrounding landscape.','https://drive.google.com/uc?export=view&id=1NI0d39X9xt8D8N731C9wRj8UfKEL4ZYq'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Painganga wildlife',  'The Painganga Wildlife Sanctuary is a protected area located in the Yavatmal district of Maharashtra, India. The sanctuary covers an area of approximately 147 sq km, and is home to a diverse range of flora and fauna.The sanctuary is known for its rich biodiversity and is home to several endangered and rare species of wildlife, including the Indian leopard, sloth bear, wild boar, and several species of deer. The sanctuary is also home to over 160 species of birds, making it a popular destination for birdwatchers.Apart from its wildlife, the sanctuary is also known for its scenic beauty. The sanctuary is located in the Satpura Range and is surrounded by dense forests, rolling hills, and beautiful streams. The sanctuary also has several trekking trails, which offer breathtaking views of the surrounding landscape.','https:https://drive.google.com/uc?export=view&id=1d5uKugUpT5KCtxuvvT-RoUeSeThB7tCn'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Nanded Fort Sachkant Gurudwara',  'Nanded Fort and Sachkhand Gurudwara are two important tourist destinations in the city of Nanded, Maharashtra.Nanded Fort, also known as Kandhar Fort, is a historical fort built by the Bahmani Sultanate in the 15th century. The fort is located on the banks of the Godavari River and was once an important military stronghold. The fort has several ancient temples, mosques, and water tanks within its premises, making it a popular destination for history buffs and architecture enthusiasts.Sachkhand Gurudwara, on the other hand, is a famous Sikh pilgrimage site located in Nanded. The gurudwara is believed to be the final resting place of Guru Gobind Singh, the tenth Sikh Guru, who passed away here in 1708. The gurudwara is one of the five Takhts or holy seats of authority of the Sikh religion and is visited by millions of devotees every year.','https://drive.google.com/uc?export=view&id=1shmXhJ1aYnuzRuzJlGkC5F-2DC7pG1IL'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ramlingam ghat',  'Ramlingam Ghat is a scenic mountain pass located in the Satpura Range of Maharashtra, India. The ghat is situated between the cities of Nashik and Dhule and is known for its scenic beauty, lush green forests, and stunning views of the surrounding landscape.Ramlingam Ghat is a popular destination for nature lovers and adventure enthusiasts, offering several trekking trails and opportunities for bird watching. The ghat is home to several species of birds, including the Malabar Whistling Thrush, which is known for its melodious song.The ghat is also known for its historical significance, as it was once an important trade route between the Maratha Kingdom and the Mughal Empire. The ghat has several ancient forts and temples, including the Ramalingeshwar Temple, which is dedicated to Lord Shiva.','https://drive.google.com/uc?export=view&id=13FM_MyT0sOA_E7tht73Pn14rTHZq8d8h'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Tulja Dev',  'Tulja Devi Temple is a popular Hindu temple located in the Osmanabad district of Maharashtra, India. The temple is dedicated to Goddess Tulja Bhavani, who is considered to be an incarnation of Goddess Durga. Tulja Bhavani is a fierce form of the goddess and is believed to protect her devotees from evil.The temple is situated on a hill and offers stunning views of the surrounding landscape. The architecture of the temple is typical of Maratha style, with intricate carvings and sculptures adorning the temple walls. The temple has several ancient idols, including the main idol of Goddess Tulja Bhavani, which is believed to have been installed in the temple over 800 years ago.','https://drive.google.com/uc?export=view&id=1isD8L6Tfs9L5X2CLSSmiayvFi1rmPRL6'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Hajarat Turabul Huq',  'Hazarat Turabul Huq is a revered shrine located in the city of Akola in the state of Maharashtra, India. It is believed to be the resting place of Hazarat Syedna Turabul Huq Shah, a Sufi saint who was known for his spiritual teachings and healing powers.The shrine is visited by devotees of different religions, including Muslims, Hindus, and Sikhs, who come to seek blessings and offer prayers. The tomb of the saint is adorned with green flags and chadars (cloths) and is considered a sacred place.According to legend, Hazarat Syedna Turabul Huq Shah was a disciple of the famous Sufi saint Khwaja Moinuddin Chishti and traveled to India from Iran to spread the message of love, peace, and harmony. He is believed to have lived a simple life and spent most of his time in meditation and spiritual practices.','https://drive.google.com/uc?export=view&id=1ygG8ZAXnB_rFu34cHUjIHyJYR1KDm3XB'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Pathri, Shirdi Saibaba Janmshtan Mandir',  'Pathri is a small village located in the Parbhani district of Maharashtra, India. It is known for being the birthplace of Sai Baba, one of the most revered saints in India. The Shirdi Sai Baba Janmasthan Mandir is a famous temple located in Pathri that marks the birthplace of Sai Baba.The temple is built in a traditional style and is a popular destination for devotees of Sai Baba. The temple complex includes several buildings, including the main temple, a dharmashala (guest house), and a museum that showcases various artifacts related to Sai Babas life.According to legend, Sai Baba was born in Pathri in the year 1835 and spent his early years in the village before moving to Shirdi, where he eventually became a saint and spiritual leader. The temple in Pathri is built on the site of Sai Babas birthplace and is considered a sacred destination for his devotees.','https://drive.google.com/uc?export=view&id=1FSdgwhjk04I-uyhMUIoI7xV98fQxVP05'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", (' Shivneri Fort(Junnar)',  'Shivneri Fort is a historic fort located near the town of Junnar in the Pune district of Maharashtra, India. It is situated atop a hill and offers stunning views of the surrounding countryside.The fort is known for being the birthplace of Chhatrapati Shivaji Maharaj, the founder of the Maratha Empire. It is believed that Shivaji was born in the fort in the year 1630 and spent his early years there.The fort has a rich history and played a significant role in the Maratha Empire. It was used as a military stronghold and was the site of several battles and conflicts. The fort is surrounded by a deep moat and has several defensive structures, including a large gate and several watchtowers.','https://drive.google.com/uc?export=view&id=1nGB0a2QlaV8f-9g6qMItF7pnTuhzySIu'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Alandi  (Samadhi of Sant Dnyaneshwar)',  'Alandi is a small town located in the Pune district of Maharashtra, India. It is a significant pilgrimage site for followers of Sant Dnyaneshwar, a 13th-century saint and poet who is considered one of the most revered figures in Maharashtrian culture.The town is known for the samadhi (tomb) of Sant Dnyaneshwar, which is located on the banks of the Indrayani River. The samadhi is a simple structure made of black stone and is surrounded by a beautiful garden. It is believed that Sant Dnyaneshwar attained enlightenment at the site and composed his famous work, Dnyaneshwari, a commentary on the Bhagavad Gita.',' https://drive.google.com/uc?export=view&id=1-BtUlu5nb2DD3X08FTq2XItCzqoFiW9f'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Lonavala',  'Lonavala is a popular hill station located in the Pune district of Maharashtra, India. It is situated in the Sahyadri mountain range and is known for its scenic beauty, pleasant climate, and natural attractions.The town is famous for its lush greenery, waterfalls, and lakes. The most popular attractions in Lonavala include the Rajmachi Point, which offers panoramic views of the surrounding valleys and hills, the Lonavala Lake, which is a popular spot for boating and picnicking, and the Karla Caves, which are ancient Buddhist rock-cut caves that date back to the 2nd century BC.','https:https://drive.google.com/uc?export=view&id=1loCtzbwSR4qhjQ4L7zGYnnDTwU8LgiIV'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Dehu',  'situated on the banks of the Indrayani River and is known for its rich cultural and religious heritage.Dehu is a significant pilgrimage site for followers of Sant Tukaram, a 17th-century poet and saint who is considered one of the most revered figures in Maharashtrian culture. The town is home to the samadhi (tomb) of Sant Tukaram, which is a simple structure made of black stone and is surrounded by a beautiful garden. The samadhi attracts thousands of devotees every year who come to pay their respects and seek blessings.Apart from the samadhi, Dehu is also home to several other temples and shrines dedicated to Sant Tukaram and other saints of the region. The town has a rich history and cultural heritage, and visitors can learn about the life and teachings of Sant Tukaram and the rich traditions of the region.','https://drive.google.com/uc?export=view&id=1WuOcGHRSN5VUBE3YnoTxmysLlWFy4GSf'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sinhgad',  'Sinhagad is a hill fortress located near Pune in the Indian state of Maharashtra. It is situated at an elevation of 1,350 meters above sea level and is a popular tourist destination and trekking spot.The fort has a rich history and has been the site of several battles and skirmishes throughout its history. It was originally built by the Bahmani Sultanate in the 14th century and was later captured by the Maratha Empire in 1670. The fort played an important role in the Maratha Empires military campaigns, and it was the site of the famous Battle of Sinhagad in 1671, in which the Marathas defeated the Mughal army.','https://drive.google.com/uc?export=view&id=1eeV_kAEyVup6w2Jt0wGu0FZYD4nXgOyr'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ranjangaon',  'Ranjangaon is a village located in the Shirur taluka of Pune district in Maharashtra, India. It is famous for the Mahaganapati temple which is one of the eight Ashtavinayak temples dedicated to Lord Ganesha. The temple is located on the Pune-Ahmednagar highway, about 50 km from Pune city. The temple is believed to have been built during the reign of Peshwa Madhavrao, in the 18th century. The Mahaganapati temple is known for its beautiful architecture and intricate carvings. The idol of Lord Ganesha in this temple is believed to be a self-manifested one, and is said to have a trunk that curves to the right. The temple is visited by thousands of devotees every year, especially during the festival of Ganesh Chaturthi.','https://drive.google.com/uc?export=view&id=1eXPOcg_cmjxeJUTsO2eYJN9vCfUscm7-'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Shaniwar wada',  'Shaniwar Wada is a historical fortification in Pune, Maharashtra, India. The fort was constructed in 1732 and served as the seat of the Peshwas of the Maratha Empire until 1818 when the British East India Company took control of the fort after defeating the Marathas. The fort has great significance in Indian history as it was witness to many important events and battles, including the assassination of Peshwa Narayanrao in 1773. Today, the fort is a popular tourist attraction and is also used for cultural events and exhibitions.','https://drive.google.com/uc?export=view&id=1QPMAQKqBw1j6ItfdIGKt6tDfrghabxeI'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Aga Khan Palace',  'Aga Khan Palace is a historical palace located in Pune, Maharashtra, India. It was built in 1892 by Sultan Muhammed Shah Aga Khan III as a way to provide employment and aid to the people of the surrounding area during a time of famine. The palace has a special place in Indian history as it was used as a prison during Indias struggle for independence. Many prominent leaders, including Mahatma Gandhi and his wife Kasturba, were imprisoned here. Today, the palace is open to the public as a museum and a memorial to Mahatma Gandhi, with exhibits and artifacts relating to his life and the Indian independence movement. The palace is surrounded by well-maintained gardens and is a popular tourist attraction in Pune.','https://drive.google.com/uc?export=view&id=1sP9sgGitBXtK8V0Al55iaHT9vRO5LmzL'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Katraj Garden',  'Katraj Snake Park and Katraj Udyan (garden) are popular tourist attractions located in Katraj, a suburb of Pune in Maharashtra, India. The Snake Park is home to a variety of snakes and reptiles, including cobras, vipers, pythons, and crocodiles, while the Udyan features a zoo with various species of animals, including tigers, lions, leopards, deer, and birds. The garden also has a large collection of plants, trees, and flowers, making it a popular spot for nature lovers and families.','https://drive.google.com/uc?export=view&id=12e3MukHbL-7GBVyqUTJmRUgJ0Lk9Z1VG'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Moregaon(Astvinayak)',  'Moregaon is a small town located in the Pune district of Maharashtra, India. It is home to the famous Moreshwar Temple, which is one of the Ashtavinayak temples dedicated to Lord Ganesha. The Ashtavinayak Yatra is a popular pilgrimage circuit in Maharashtra, and Moregaon is the first temple visited on this circuit.The Moreshwar Temple is believed to have been built during the Bahamani period in the 14th century. The temple is situated on a small hillock, and is surrounded by four hills. The idol of Lord Ganesha in the temple is said to be self-manifested (swayambhu), and is adorned with diamonds and other precious stones.','https://drive.google.com/uc?export=view&id=1YftpNSLkDDjpsqInMJx8tydPS5aIsg3I/view?usp=share_link'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Rajgarh Fort',  'Rajgarh Fort is a hill fort located near the city of Pune in Maharashtra, India. The fort was initially built in the 17th century by Chhatrapati Shivaji Maharaj and was later renovated by the Peshwas. The fort is situated at a height of around 4,514 feet above sea level and provides a panoramic view of the Sahyadri Mountains. Rajgarh Fort is known for its historical significance and is a popular tourist destination. The fort can be accessed by trekking and is a popular destination for adventure enthusiasts.','https://drive.google.com/uc?export=view&id=1x4hYCRs9LF8yuibLDObnRliWQb_yCyz4'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Torna Fort',  'Torna Fort, also known as Prachandagad, is a hill fort located near Pune in the state of Maharashtra, India. It is situated in the Sahyadri mountain range and is one of the tallest forts in the region, standing at an elevation of 1,403 meters (4,603 feet). The fort played a significant role in the Maratha Empire, serving as a military base and stronghold. It was captured by Shivaji Maharaj in 1643 and was later fortified by him. The fort offers panoramic views of the surrounding hills and valleys and is a popular destination for trekking and camping. The trek to the fort is moderately challenging, and the best time to visit is during the monsoon season, from June to September, when the surrounding landscape is lush and green.','https://drive.google.com/uc?export=view&id=1ex5BnHdBCt582K2JRFjG8e6AZF_lP8bd'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Theur(ashtvinayak)',  'Theur is a village located in the Pune district of Maharashtra, India. It is famous for the Chintamani Ganpati Temple, which is one of the eight Ashtavinayak temples in Maharashtra. The temple is dedicated to Lord Ganesha, who is known as Chintamani, the remover of all worries and troubles. The temple is believed to have been built during the Peshwa dynasty in the 18th century.The idol of Lord Ganesha in the Chintamani Ganpati Temple is believed to be a swayambhu (self-manifested) idol, which means it was not carved by any human being. The temple complex also includes a small pond, known as Kadamb Sarovar, which is believed to have been created by Lord Ganesha himself.','https://drive.google.com/uc?export=view&id=1kMyNXL_dP7Ya7HuJW3z7g278bEwoBweU'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Parvati (hill and Temple,Oldest heritage)',  'Parvati Hill is a hillock in Pune, Maharashtra, India, and it is one of the citys most famous landmarks. The hill is around 2,100 feet high and offers panoramic views of Pune. At the top of the hill, there is the Parvati Temple, one of the oldest heritage sites in Pune. The temple is dedicated to various Hindu deities, including Lord Shiva, Lord Vishnu, Lord Ganesh, and Goddess Parvati. It was built during the reign of the Peshwa dynasty in the 18th century and is famous for its beautiful architecture and intricate carvings. Parvati Hill and Temple are also popular among tourists and locals alike for their serene and peaceful atmosphere, making it an ideal spot for meditation and relaxation.','https://drive.google.com/uc?export=view&id=1fUxgXzuxW6oOHRc74rBNditt6uA2K9N7'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Lohagad',  'Lohagad is a historical fort located near Lonavala in Maharashtra, India. The fort was built during the 18th century by the Maratha Empire, and it played a vital role in various battles. Lohagad is a popular destination among trekkers and nature lovers, as it offers breathtaking views of the surrounding hills and valleys. The fort is also home to several ancient temples, such as the Vinchukata Temple and the Shiv Temple. The forts architecture and design showcase the ingenuity of Maratha engineering and their ability to construct sturdy and robust structures.','https://drive.google.com/uc?export=view&id=19kX9syIls9nxO3_23GBQWEDcalIAxeHD'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Khurundar Fort',  'Khurundar Fort, also known as Kurundvad Fort, is located in Kurundvad village in the Sindhudurg district of Maharashtra. The fort is situated on a hill overlooking the Kurundvad creek and the Arabian Sea. It was built by the Maratha Empire in the 17th century to protect the region from foreign invaders.The fort has a triangular shape and is surrounded by a moat on three sides. It has two main gates, one facing the landward side and the other facing the sea. The fort has a few structures inside, including a temple, a water tank, and a few residential buildings.','https://drive.google.com/uc?export=view&id=1NDrQUioZwVY92er54-dnfJuT1zMjH89z'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Jejuri (khandoba or Khandobachi Temple)',  'Jejuri is a small town located in the Pune district of Maharashtra, India. It is famous for the Khandoba Temple, also known as Khandobachi Jejuri. The temple is dedicated to Lord Khandoba, a Hindu deity worshipped as the god of Jejuri.The temple is built on a hill and is surrounded by beautiful landscapes. The temple complex is decorated with colorful flags, and the entrance is marked by two huge silver-plated doors. The main deity of the temple is a black stone statue of Lord Khandoba with a dog on one side and a horse on the other.',' https://drive.google.com/uc?export=view&id=1d_SaLCq_ITFf_BUvw5FU-YJ6gara0s2J'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Matheran',  'Matheran is a small hill station located in the Raigad district of Maharashtra, India. It is situated at an altitude of 800 m above sea level and is known for its picturesque views of the surrounding hills and valleys. Matheran is known for its eco-sensitive environment and is declared as an eco-sensitive region by the Ministry of Environment and Forests.The hill station is known for its pleasant weather throughout the year and is a popular weekend getaway for people from Mumbai and Pune. Matheran has a toy train that runs from Neral to Matheran, which is a popular tourist attraction. The train ride offers scenic views of the surrounding hills and valleys.','https://drive.google.com/uc?export=view&id=1rE0jmWY_QURt6YcghFIA19bilQPXtYUa'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Alibag, Fort, Mandva',  'Alibag is a coastal town located in Raigad district in the Konkan region of Maharashtra, India. It is a popular weekend getaway destination known for its beautiful beaches, historic forts, and temples. Some of the popular attractions in and around Alibag are:Alibag Beach - It is a popular beach in Alibag known for its beautiful sunsets and clean waters.Kolaba Fort - It is a historic fort located in the sea near Alibag. Visitors can reach the fort by boat during low tide.Kanakeshwar Forest - It is a dense forest located near Alibag that is home to a variety of wildlife species.Mandva Beach - It is a beautiful beach located about 20 km from Alibag known for its clean waters and water sports activities.','https://drive.google.com/uc?export=view&id=1QCGPeEHvuWJfexZ5LJIJ1wI2XfzlIanj'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Murud-Janjira',  'Murud-Janjira is a coastal town in the Raigad district of Maharashtra, India. It is known for its famous Murud-Janjira Fort, which is situated on an island just off the coast of the town. The fort is believed to have been built in the 15th century and is known for its impressive architecture and military strategies.The fort has been well-preserved over the centuries and still stands as a testament to the rich history and culture of the region. It is surrounded by the Arabian Sea on all sides and is accessible only by boats. The fort features several impressive structures including the main gate, the palace, the mosque, and several cannons.','https://drive.google.com/uc?export=view&id=1ah4SmPBQ3IzdcW8IdiZPTTZS-nd2Na4g'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Phansad wildlife sanctury',  'Phansad Wildlife Sanctuary is a protected area located in the Raigad district of Maharashtra, India. It covers an area of around 60 square kilometers and is home to a diverse range of flora and fauna.The sanctuary is situated in the Western Ghats and is known for its rich biodiversity. It is home to several species of animals including leopards, barking deer, mouse deer, wild boars, Indian civets, and several species of birds and reptiles. The sanctuary is also home to several species of trees and plants including teak, mango, jamun, and bamboo.The sanctuary offers visitors the opportunity to explore the natural beauty of the Western Ghats and experience its rich biodiversity. Visitors can take a guided trek through the sanctuary, which offers stunning views of the surrounding hills and valleys. The sanctuary also offers opportunities for bird watching and wildlife photography.','https://drive.google.com/uc?export=view&id=1xur5Lf5fHBO-0eePEEU8AbkZBt-M03c2'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Mahad (Ashtavinayak)',  'Mahad is a town located in the Raigad district of Maharashtra, India. It is famous for being one of the eight locations where the Ashtavinayak temples are located. The Ashtavinayak temples are dedicated to Lord Ganesha and are considered to be very sacred by Hindus. The Mahad Ashtavinayak temple is dedicated to Varadvinayak, one of the eight forms of Lord GaneshaThe temple is located on a hill and offers a beautiful view of the surrounding hills and valleys. The temple complex is also home to a large pond called the Masunda Talav, which is said to have been built by the Pandavas during their exile. The pond is also known as Shreevardhan Talav and is considered to be very sacred.',' https://drive.google.com/uc?export=view&id=1iGedsN-zOGK91fgQOPVwP5mCmwoZqzpr'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ganpatipule',  'Ganpatipule is a coastal village located in the Ratnagiri district of Maharashtra, India. The village is famous for its pristine beaches, ancient temples, and scenic beauty. It is located on the Konkan coast and is surrounded by lush green forests and hills.The Ganpatipule beach is one of the major attractions of the village and is known for its clear waters and golden sand. Visitors can enjoy water sports, such as swimming and boating, or simply relax and soak in the beauty of the surroundings. The beach is also known for the Ganpati temple, which is located on the shore and is believed to be more than 400 years old.','https://drive.google.com/uc?export=view&id=1_nG-HT7TNdjlwJcZRyVjSD51QYgea56r'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Harnai Beach',  'Chandoli Wildlife Sanctuary is a protected area located in the Satara district of Maharashtra, India. It was established in 1985 and covers an area of approximately 317.67 square kilometers. The sanctuary is named after the Chandoli Dam, which was built across the River Chandoli and is located within the sanctuary.The sanctuary is known for its rich biodiversity and is home to several species of flora and fauna. The major species of wildlife found here include tigers, leopards, Indian bison (also known as gaur), sambar deer, barking deer, and chital. The sanctuary is also home to several species of birds and reptiles.The Chandoli Dam is a major attraction within the sanctuary and offers a picturesque view of the surrounding hills and valleys. Visitors can also enjoy trekking and hiking in the sanctuary and explore the various waterfalls, such as the Vasant Sagar and the Kandati Waterfall.',' https://drive.google.com/uc?export=view&id=1iynJsL57oB7sKMwnfLTnW6i_w2sdLVKq'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Chandoli Wildlife Sanctuary,Manadur',  'Chandoli Wildlife Sanctuary is a protected area located in the Satara district of Maharashtra, India. It was established in 1985 and covers an area of approximately 317.67 square kilometers. The sanctuary is named after the Chandoli Dam, which was built across the River Chandoli and is located within the sanctuary.The sanctuary is known for its rich biodiversity and is home to several species of flora and fauna. The major species of wildlife found here include tigers, leopards, Indian bison (also known as gaur), sambar deer, barking deer, and chital. The sanctuary is also home to several species of birds and reptiles.The Chandoli Dam is a major attraction within the sanctuary and offers a picturesque view of the surrounding hills and valleys. Visitors can also enjoy trekking and hiking in the sanctuary and explore the various waterfalls, such as the Vasant Sagar and the Kandati Waterfall.'," https://drive.google.com/uc?export=view&id=1a3vwA-nZzlwbREwwYBFtnnUL47Hishg-"))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Mahabalewar/prapgarh fort',  'Mahabaleshwar is a popular hill station located in the Satara district of Maharashtra, India. It is situated at an altitude of 1,353 meters above sea level and is known for its scenic beauty, pleasant weather, and fresh strawberries.Mahabaleshwar is home to several viewpoints, such as the Arthurs Seat, Needle Hole Point, and Wilson Point, which offer stunning views of the surrounding hills and valleys. The town is also known for its ancient temples, such as the Mahabaleshwar Temple and the Panchganga Temple.Another popular attraction near Mahabaleshwar is the Pratapgad Fort, which is located about 22 km from the town. The fort was built in the 17th century and is known for its historical significance and architectural beauty. It played a crucial role in the Battle of Pratapgad, which was fought between the Maratha warrior Shivaji and the Mughal army.','https://drive.google.com/uc?export=view&id=1QeaByvYXKEIzgEn8u11584SvLsPqwPtC'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Panchgani',  'Panchgani is a beautiful hill station located in the Satara district of Maharashtra, India. It is situated at an altitude of 1,338 meters above sea level and is known for its pleasant climate, scenic beauty, and strawberry farms.Visitors to Panchgani can enjoy a range of activities, including trekking, hiking, and paragliding. The hill station is also known for its viewpoints, such as Sydney Point, Parsi Point, and Table Land, which offer stunning views of the surrounding hills and valleys.Panchgani is also famous for its strawberry farms, which produce some of the best quality strawberries in the country. Visitors can visit the farms and enjoy freshly picked strawberries, along with other local produce.','https://drive.google.com/uc?export=view&id=1ZJ9d4vUxZbRTxRj6-u5s8UUW0HA5pW75'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ajinkyatra fort,Sajangarh',  'Ajinkyatara Fort is a historic fort located in the Satara district of Maharashtra, India. It is situated at an altitude of 3,300 feet above sea level and provides a panoramic view of the surrounding hills and valleys.The fort is known for its impressive architecture and strategic location. It was built by the Satara kings in the 16th century and was later captured by the Maratha ruler Shivaji. The fort played a crucial role in several battles fought by the Marathas.Visitors to Ajinkyatara Fort can explore its various structures, including the entrance gate, the bastions, the temples, and the water tanks. The fort also has a museum that displays various artifacts related to the fors history.Sajjangad is another popular attraction near Ajinkyatara Fort. It is a fort located near the town of Satara and is known for its historical significance. The fort was the residence of the saint and social reformer, Samarth Ramdas, who was also the mentor of the Maratha king Shivaji. Visitors can explore the various structures within the fort, including the temples, the Samadhi of Samarth Ramdas, and the residence of the saint.',' https://drive.google.com/uc?export=view&id=1SAFCi2byOpNWvPt3mAJoiUc4nAKiRXdD'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Koyna lake',  'Koyna Lake is a beautiful lake located in the Satara district of Maharashtra, India. The lake is formed by the Koyna Dam, which is one of the largest hydroelectric projects in India. The lake is surrounded by the Sahyadri mountain range and dense forests, making it a popular tourist destination for nature lovers.Visitors can enjoy a variety of activities at Koyna Lake, such as boating, kayaking, and fishing. The lake is home to several species of fish, including mahseer, which is a popular game fish. Visitors can rent boats or hire a guide to explore the lake and catch some fish.The area around Koyna Lake is also known for its scenic beauty and wildlife. Visitors can go on a nature walk, explore the nearby forests, and spot a variety of animals, including tigers, leopards, and deer.','https://drive.google.com/uc?export=view&id=14BPEuywVfuG3PbTXJyCTYSjGDVY0tftw'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Malvan beach , Fort',  'Malvan is a coastal town in the Sindhudurg district of Maharashtra, India, known for its scenic beaches and historical forts. The Malvan Beach is a popular destination for tourists, with its pristine white sands and crystal-clear waters. It is an ideal spot for swimming, sunbathing, and relaxation.The Malvan Fort, also known as the Sindhudurg Fort, is located on a rocky island in the Arabian Sea near Malvan Beach. It was built in the 17th century by the Maratha warrior king, Shivaji, to protect the coastline from foreign invaders. The fort has several interesting features, including a secret tunnel and a unique hollow bastion that was used for storing ammunition.','https://drive.google.com/uc?export=view&id=1j1rEzt8D6AxPN0RPAbZtfjEtSJwjDTDC'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Tarkarli',  'Tarkarli is a popular tourist destination located in the Sindhudurg district of Maharashtra, India. It is known for its pristine beaches, clear blue waters, and serene natural beauty. The beach at Tarkarli is especially famous for its white sand and crystal clear waters, making it an ideal destination for swimming and water sports.Apart from the beach, Tarkarli is also known for its marine life and is a popular destination for scuba diving and snorkeling. Visitors can explore the coral reefs and see a wide variety of marine creatures, including colorful fish, sea turtles, and even dolphins.In addition to water sports, visitors to Tarkarli can also enjoy other activities such as hiking, trekking, and bird watching. The nearby backwaters and estuaries are home to a variety of bird species, making it an ideal destination for bird watching enthusiasts.',' https://drive.google.com/uc?export=view&id=1qlxRmQe1Sx62pDsJrbs93jrb1ENi2qa7'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Vijaydurg fort',  'Vijaydurg Fort is a historic fort located in the Sindhudurg district of Maharashtra, India. It is situated on the coast of the Arabian Sea and was built during the 17th century by the Maratha king, Shivaji. The fort was originally called "Gheria" and was later renamed as "Vijaydurg" after it was captured by the Marathas.The fort has a strategic location and was used to control the trade routes between Maharashtra and Goa. It was also used as a naval base by the Marathas and was equipped with a number of cannons and other weapons.','https://drive.google.com/uc?export=view&id=1ISwd9dC9qkkeAhZWR8IShshd4x1uB7Vs'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Amboli Waterfalls',  'Amboli Waterfalls is a popular tourist attraction located in the town of Amboli in the Sindhudurg district of Maharashtra, India. It is a beautiful waterfall that cascades down from a height of approximately 100 feet.The waterfall is surrounded by lush green forests and is located in the midst of the Amboli Ghat, which is a popular hill station in the Western Ghats of Maharashtra. The area around the waterfall is perfect for trekking and hiking, and visitors can also enjoy swimming in the pool at the base of the waterfall.','https://drive.google.com/uc?export=view&id=1VI6v33J20sgxmOUz3z9bwunLgmuPrTPo'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Kundalsangam,Akalkote',  'Kundalsangam is a small village located in the Solapur district of Maharashtra, India. It is known for its historical and religious significance, particularly for the Akkalkot Swami Maharaj temple.The temple is dedicated to Swami Samartha, a saint who is believed to have lived in the village of Akkalkot during the 19th century. The temple is a major pilgrimage site for devotees of Swami Samartha, who come from all over Maharashtra to seek his blessings.Apart from the temple, Kundalsangam is also home to the Shri Sant Seetaram Maharaj Math, which is a popular ashram that offers accommodation and food for pilgrims and visitors. The ashram is known for its peaceful atmosphere and beautiful gardens.','https://drive.google.com/uc?export=view&id=18Go4QJVigLye6dl1V7AAcXT3Y6UQFdsv'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Pandharpur',  'Pandharpur is a town located in the Solapur district of Maharashtra, India. It is a major pilgrimage site for followers of Hinduism, particularly the devotees of Lord Vitthal, an incarnation of Lord Vishnu.The town is home to the famous Vitthal Rukmini Temple, which is one of the most important temples in Maharashtra. The temple is believed to have been built during the 12th century and features a beautiful idol of Lord Vitthal and his consort Rukmini.Every year, thousands of devotees from all over the country visit Pandharpur during the Ashadhi and Kartiki Ekadashi festivals to seek the blessings of Lord Vitthal. During these festivals, devotees participate in the traditional Wari procession, which involves walking from their home towns to Pandharpur while chanting the name of Lord Vitthal.','https://drive.google.com/uc?export=view&id=1vRrBEs8CB0AnRQ2AWRhK0nTr3ZFyVuMK'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Kelve Beach, Fort And And Dame,Palghar',  'Kelve Beach is a beautiful and secluded beach located in Palghar district, Maharashtra, India. It is known for its pristine sandy shores, clear blue waters and serene atmosphere. The beach is surrounded by lush green coconut groves and is an ideal spot for relaxation and picnics.Apart from the beach, Kelve is also home to an ancient fort, known as the Kelve Fort. The fort dates back to the 16th century and is situated atop a small hill overlooking the beach. Visitors can explore the fort and admire its ancient architecture and intricate carvings.Another popular attraction in Kelve is the Tansa Dam, which is located nearby. The dam is a major source of water for the region and offers stunning views of the surrounding hills and valleys.','https://drive.google.com/uc?export=view&id=1dfz2BcarUswlG5wh5oG9Nes4mVmDMbXc'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('AMBARNATH (shiv Temple)/ Ganesh Temple in Titwala',  'Ambarnath is a town located in the Thane district of Maharashtra, India. It is known for its ancient Shiva Temple, which is a popular pilgrimage site for followers of Hinduism. The temple is located on the banks of the Waldhuni River and is believed to have been built during the 11th century.The Ambarnath Shiva Temple is a beautiful example of ancient Indian temple architecture, with intricate carvings and sculptures adorning the walls and pillars. The temple features a large Shiva lingam, which is worshipped by devotees who come from all over the country to seek the blessings of Lord Shiva.','https://drive.google.com/uc?export=view&id=1qQdvRrErIO1LAvsRkmTlGPWT63HKkX9X'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Sevagram',  'Sevagram is a small village located in the Wardha district of Maharashtra, India. It is known for its association with Mahatma Gandhi, who lived in the village from 1936 until his death in 1948. The village is a popular pilgrimage site for followers of Gandhian philosophy and is visited by thousands of people every year.During his stay in Sevagram, Mahatma Gandhi set up an ashram, which served as a center for his social and political activities. The ashram, known as the Sevagram Ashram, was a hub of activity and attracted many followers from across the country who were inspired by Gandhis teachings of nonviolence, self-reliance, and social justice.','https://drive.google.com/uc?export=view&id=1K89J_hrhp768VYXGBjX42MosPIq9dHuZ'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Shirpur ( Parshwanath Digamber Jain Mandir)',  'Shirpur is a small town located in the Dhule district of Maharashtra, India. It is known for its rich cultural heritage and is home to several ancient temples, including the Parshwanath Digamber Jain Mandir.The Parshwanath Digamber Jain Mandir is a popular pilgrimage site for followers of Jainism. The temple is dedicated to Lord Parshwanath, who is considered to be the 23rd Tirthankara of Jainism. The temple complex is spread over a large area and features several beautifully crafted idols of Lord Parshwanath and other deities.','https://drive.google.com/uc?export=view&id=1XNcAvGpAm_3pqD26Oq_0hKG9-D_nDNq0'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Kalamb Tipeshwar Sanctury',  'Kalamb-Tipeshwar Wildlife Sanctuary is located in the Yavatmal district of Maharashtra, India. It covers an area of approximately 149 square kilometers and is home to a diverse range of flora and fauna.The sanctuary is known for its rich biodiversity and is home to a variety of species, including tigers, leopards, sloth bears, sambar deer, barking deer, chital, wild boar, and Indian gaur. The sanctuary is also home to several species of birds, including peafowl, jungle fowl, quails, partridges, and several species of eagles and hawks.','https://drive.google.com/uc?export=view&id=1Z3d3OCFENpRBDe3AbE7hstmjGIrxhhSU'))
cursor.execute("INSERT INTO my_table (name, description,url) VALUES (?,?,?)", ('Ghatanji & Kaleshwar',  'Ghatanji and Kaleshwar are two small towns located in the Yavatmal district of Maharashtra, India.Ghatanji is a small town known for its historic significance. It was an important center of trade and commerce during the medieval period and was ruled by various dynasties, including the Satavahanas, the Vakatakas, and the Chalukyas. The town is also known for its beautiful temples, including the Ghatanji Temple, which is dedicated to Lord Shiva and is a popular pilgrimage site for devotees.Kaleshwar is a small village located near Ghatanji and is known for its ancient Kaleshwar Temple, which is dedicated to Lord Shiva. The temple is believed to have been built during the reign of the Chalukya dynasty and is a popular pilgrimage site for devotees. The village is also known for its beautiful natural surroundings and is a great destination for nature lovers and trekking enthusiasts.','https://drive.google.com/uc?export=view&id=1oqIMj_K7TnVt6069z43LDAXZ3y0Gr1tl'))
